@testset "1.2.1.1 (a+b x+c x^2)^p" begin
    (a, b, c, k, n, p, x, ) = @variables a b c k n p x

    #= ::Package:: =#

    #= ::Title:: =#
    #=Integrands*of*the*form*(a+b*x+c*x^2)^p=#


    #= ::Section::Closed:: =#
    #=Integrands*of*the*form*(a+b*x+c*x^2)^p*when*a=0=#


    #= ::Subsection::Closed:: =#
    #=Integrands*of*the*form*(b*x+c*x^2)^(p/2)=#


    #= ::Subsubsection::Closed:: =#
    #=p>0=#


    @test_int [(b*x + c*x^2)^(7/2), x, 6, -((35*b^6*(b + 2*c*x)*sqrt(b*x + c*x^2))/(16384*c^4)) + (35*b^4*(b + 2*c*x)*(b*x + c*x^2)^(3/2))/(6144*c^3) - (7*b^2*(b + 2*c*x)*(b*x + c*x^2)^(5/2))/(384*c^2) + ((b + 2*c*x)*(b*x + c*x^2)^(7/2))/(16*c) + (35*b^8*atanh((sqrt(c)*x)/sqrt(b*x + c*x^2)))/(16384*c^(9/2))]


    @test_int [(3*im*x + 4*x^2)^(7/2), x, 6, (25515*(3*im + 8*x)*sqrt(3*im*x + 4*x^2))/4194304 + (945*(3*im + 8*x)*(3*im*x + 4*x^2)^(3/2))/131072 + (21*(3*im + 8*x)*(3*im*x + 4*x^2)^(5/2))/2048 + (1/64)*(3*im + 8*x)*(3*im*x + 4*x^2)^(7/2) + (229635*im*asin(1 - (8*im*x)/3))/16777216]
    @test_int [(3*im*x + 4*x^2)^(5/2), x, 5, (405*(3*im + 8*x)*sqrt(3*im*x + 4*x^2))/32768 + (15*(3*im + 8*x)*(3*im*x + 4*x^2)^(3/2))/1024 + (1/48)*(3*im + 8*x)*(3*im*x + 4*x^2)^(5/2) + (3645*im*asin(1 - (8*im*x)/3))/131072]
    @test_int [(3*im*x + 4*x^2)^(3/2), x, 4, (27*(3*im + 8*x)*sqrt(3*im*x + 4*x^2))/1024 + (1/32)*(3*im + 8*x)*(3*im*x + 4*x^2)^(3/2) + (243*im*asin(1 - (8*im*x)/3))/4096]
    @test_int [(3*im*x + 4*x^2)^(1/2), x, 3, (1/16)*(3*im + 8*x)*sqrt(3*im*x + 4*x^2) + (9/64)*im*asin(1 - (8*im*x)/3)]


    @test_int [(3*x - 4*x^2)^(7/2), x, 6, -((25515*(3 - 8*x)*sqrt(3*x - 4*x^2))/4194304) - (945*(3 - 8*x)*(3*x - 4*x^2)^(3/2))/131072 - (21*(3 - 8*x)*(3*x - 4*x^2)^(5/2))/2048 - (1/64)*(3 - 8*x)*(3*x - 4*x^2)^(7/2) - (229635*asin(1 - (8*x)/3))/16777216]
    @test_int [(3*x - 4*x^2)^(5/2), x, 5, -((405*(3 - 8*x)*sqrt(3*x - 4*x^2))/32768) - (15*(3 - 8*x)*(3*x - 4*x^2)^(3/2))/1024 - (1/48)*(3 - 8*x)*(3*x - 4*x^2)^(5/2) - (3645*asin(1 - (8*x)/3))/131072]
    @test_int [(3*x - 4*x^2)^(3/2), x, 4, -((27*(3 - 8*x)*sqrt(3*x - 4*x^2))/1024) - (1/32)*(3 - 8*x)*(3*x - 4*x^2)^(3/2) - (243*asin(1 - (8*x)/3))/4096]
    @test_int [(3*x - 4*x^2)^(1/2), x, 3, (-(1/16))*(3 - 8*x)*sqrt(3*x - 4*x^2) - (9/64)*asin(1 - (8*x)/3)]


    @test_int [sqrt(6*x - x^2), x, 3, (-(1/2))*(3 - x)*sqrt(6*x - x^2) - (9/2)*asin(1 - x/3)]
    @test_int [sqrt(5*x - 9*x^2), x, 3, (-(1/36))*(5 - 18*x)*sqrt(5*x - 9*x^2) - (25/216)*asin(1 - (18*x)/5)]
    @test_int [(x - x^2)^(3/2), x, 4, (-(3/64))*(1 - 2*x)*sqrt(x - x^2) - (1/8)*(1 - 2*x)*(x - x^2)^(3/2) - (3/128)*asin(1 - 2*x)]


    @test_int [sqrt(4*x + x^2), x, 3, (1/2)*(2 + x)*sqrt(4*x + x^2) - 4*atanh(x/sqrt(4*x + x^2))]
    @test_int [sqrt(-8*x + x^2), x, 3, (-(1/2))*(4 - x)*sqrt(-8*x + x^2) - 16*atanh(x/sqrt(-8*x + x^2))]
    @test_int [sqrt(-x + x^2), x, 3, (-(1/4))*(1 - 2*x)*sqrt(-x + x^2) - (1/4)*atanh(x/sqrt(-x + x^2))]


    #= ::Subsubsection::Closed:: =#
    #=p<0=#


    @test_int [1/(b*x + c*x^2)^(7/2), x, 3, -((2*(b + 2*c*x))/(5*b^2*(b*x + c*x^2)^(5/2))) + (32*c*(b + 2*c*x))/(15*b^4*(b*x + c*x^2)^(3/2)) - (256*c^2*(b + 2*c*x))/(15*b^6*sqrt(b*x + c*x^2))]


    @test_int [1/(3*im*x + 4*x^2)^(1/2), x, 2, (1/2)*im*asin(1 - (8*im*x)/3)]
    @test_int [1/(3*im*x + 4*x^2)^(3/2), x, 1, (2*(3*im + 8*x))/(9*sqrt(3*im*x + 4*x^2))]
    @test_int [1/(3*im*x + 4*x^2)^(5/2), x, 2, (2*(3*im + 8*x))/(27*(3*im*x + 4*x^2)^(3/2)) + (64*(3*im + 8*x))/(243*sqrt(3*im*x + 4*x^2))]
    @test_int [1/(3*im*x + 4*x^2)^(7/2), x, 3, (2*(3*im + 8*x))/(45*(3*im*x + 4*x^2)^(5/2)) + (128*(3*im + 8*x))/(1215*(3*im*x + 4*x^2)^(3/2)) + (4096*(3*im + 8*x))/(10935*sqrt(3*im*x + 4*x^2))]


    @test_int [1/(3*x - 4*x^2)^(1/2), x, 2, (-(1/2))*asin(1 - (8*x)/3)]
    @test_int [1/(3*x - 4*x^2)^(3/2), x, 1, -((2*(3 - 8*x))/(9*sqrt(3*x - 4*x^2)))]
    @test_int [1/(3*x - 4*x^2)^(5/2), x, 2, -((2*(3 - 8*x))/(27*(3*x - 4*x^2)^(3/2))) - (64*(3 - 8*x))/(243*sqrt(3*x - 4*x^2))]
    @test_int [1/(3*x - 4*x^2)^(7/2), x, 3, -((2*(3 - 8*x))/(45*(3*x - 4*x^2)^(5/2))) - (128*(3 - 8*x))/(1215*(3*x - 4*x^2)^(3/2)) - (4096*(3 - 8*x))/(10935*sqrt(3*x - 4*x^2))]


    @test_int [1/sqrt(b*x - b^2*x^2), x, 2, -(asin(1 - 2*b*x)/b)]
    @test_int [1/sqrt(b*x + b^2*x^2), x, 2, (2*atanh((b*x)/sqrt(b*x + b^2*x^2)))/b]


    @test_int [1/sqrt(6*x - x^2), x, 2, -asin(1 - x/3)]
    @test_int [1/sqrt(4*x + x^2), x, 2, 2*atanh(x/sqrt(4*x + x^2))]
    @test_int [1/sqrt(-2*x + x^2), x, 2, 2*atanh(x/sqrt(-2*x + x^2))]


    #= ::Subsection::Closed:: =#
    #=Integrands*of*the*form*(b*x+c*x^2)^(p/3)=#


    @test_int [(b*x + c*x^2)^(4/3), x, 6, (3*(-((c*x*(b + c*x))/b^2))^(1/3)*(b + 2*c*x)*(b*x + c*x^2)^(4/3))/(55*c*(-((c*(b*x + c*x^2))/b^2))^(4/3)) + (3*(-((c*x*(b + c*x))/b^2))^(4/3)*(b + 2*c*x)*(b*x + c*x^2)^(4/3))/(22*c*(-((c*(b*x + c*x^2))/b^2))^(4/3)) + (2^(1/3)*3^(3/4)*sqrt(2 - sqrt(3))*b^2*(b*x + c*x^2)^(4/3)*(1 - 2^(2/3)*(-((c*x*(b + c*x))/b^2))^(1/3))*sqrt((1 + 2^(2/3)*(-((c*x*(b + c*x))/b^2))^(1/3) + 2*2^(1/3)*(-((c*x*(b + c*x))/b^2))^(2/3))/(1 - sqrt(3) - 2^(2/3)*(-((c*x*(b + c*x))/b^2))^(1/3))^2)*Elliptic.F(asin((1 + sqrt(3) - 2^(2/3)*(-((c*x*(b + c*x))/b^2))^(1/3))/(1 - sqrt(3) - 2^(2/3)*(-((c*x*(b + c*x))/b^2))^(1/3))), -7 + 4*sqrt(3)))/(55*c*(b + 2*c*x)*(-((c*(b*x + c*x^2))/b^2))^(4/3)*sqrt(-((1 - 2^(2/3)*(-((c*x*(b + c*x))/b^2))^(1/3))/(1 - sqrt(3) - 2^(2/3)*(-((c*x*(b + c*x))/b^2))^(1/3))^2)))]
    @test_int [(b*x + c*x^2)^(1/3), x, 5, (3*(-((c*x*(b + c*x))/b^2))^(1/3)*(b + 2*c*x)*(b*x + c*x^2)^(1/3))/(10*c*(-((c*(b*x + c*x^2))/b^2))^(1/3)) + (3^(3/4)*sqrt(2 - sqrt(3))*b^2*(b*x + c*x^2)^(1/3)*(1 - 2^(2/3)*(-((c*x*(b + c*x))/b^2))^(1/3))*sqrt((1 + 2^(2/3)*(-((c*x*(b + c*x))/b^2))^(1/3) + 2*2^(1/3)*(-((c*x*(b + c*x))/b^2))^(2/3))/(1 - sqrt(3) - 2^(2/3)*(-((c*x*(b + c*x))/b^2))^(1/3))^2)*Elliptic.F(asin((1 + sqrt(3) - 2^(2/3)*(-((c*x*(b + c*x))/b^2))^(1/3))/(1 - sqrt(3) - 2^(2/3)*(-((c*x*(b + c*x))/b^2))^(1/3))), -7 + 4*sqrt(3)))/(5*2^(2/3)*c*(b + 2*c*x)*(-((c*(b*x + c*x^2))/b^2))^(1/3)*sqrt(-((1 - 2^(2/3)*(-((c*x*(b + c*x))/b^2))^(1/3))/(1 - sqrt(3) - 2^(2/3)*(-((c*x*(b + c*x))/b^2))^(1/3))^2)))]
    @test_int [1/(b*x + c*x^2)^(2/3), x, 4, (2^(1/3)*3^(3/4)*sqrt(2 - sqrt(3))*b^2*(-((c*(b*x + c*x^2))/b^2))^(2/3)*(1 - 2^(2/3)*(-((c*x*(b + c*x))/b^2))^(1/3))*sqrt((1 + 2^(2/3)*(-((c*x*(b + c*x))/b^2))^(1/3) + 2*2^(1/3)*(-((c*x*(b + c*x))/b^2))^(2/3))/(1 - sqrt(3) - 2^(2/3)*(-((c*x*(b + c*x))/b^2))^(1/3))^2)*Elliptic.F(asin((1 + sqrt(3) - 2^(2/3)*(-((c*x*(b + c*x))/b^2))^(1/3))/(1 - sqrt(3) - 2^(2/3)*(-((c*x*(b + c*x))/b^2))^(1/3))), -7 + 4*sqrt(3)))/(c*(b + 2*c*x)*(b*x + c*x^2)^(2/3)*sqrt(-((1 - 2^(2/3)*(-((c*x*(b + c*x))/b^2))^(1/3))/(1 - sqrt(3) - 2^(2/3)*(-((c*x*(b + c*x))/b^2))^(1/3))^2)))]
    @test_int [1/(b*x + c*x^2)^(5/3), x, 5, (3*(b + 2*c*x)*(-((c*(b*x + c*x^2))/b^2))^(5/3))/(2*c*(-((c*x*(b + c*x))/b^2))^(2/3)*(b*x + c*x^2)^(5/3)) + (2^(1/3)*3^(3/4)*sqrt(2 - sqrt(3))*b^2*(-((c*(b*x + c*x^2))/b^2))^(5/3)*(1 - 2^(2/3)*(-((c*x*(b + c*x))/b^2))^(1/3))*sqrt((1 + 2^(2/3)*(-((c*x*(b + c*x))/b^2))^(1/3) + 2*2^(1/3)*(-((c*x*(b + c*x))/b^2))^(2/3))/(1 - sqrt(3) - 2^(2/3)*(-((c*x*(b + c*x))/b^2))^(1/3))^2)*Elliptic.F(asin((1 + sqrt(3) - 2^(2/3)*(-((c*x*(b + c*x))/b^2))^(1/3))/(1 - sqrt(3) - 2^(2/3)*(-((c*x*(b + c*x))/b^2))^(1/3))), -7 + 4*sqrt(3)))/(c*(b + 2*c*x)*(b*x + c*x^2)^(5/3)*sqrt(-((1 - 2^(2/3)*(-((c*x*(b + c*x))/b^2))^(1/3))/(1 - sqrt(3) - 2^(2/3)*(-((c*x*(b + c*x))/b^2))^(1/3))^2)))]
    @test_int [1/(b*x + c*x^2)^(8/3), x, 6, (3*(b + 2*c*x)*(-((c*(b*x + c*x^2))/b^2))^(8/3))/(5*c*(-((c*x*(b + c*x))/b^2))^(5/3)*(b*x + c*x^2)^(8/3)) + (21*(b + 2*c*x)*(-((c*(b*x + c*x^2))/b^2))^(8/3))/(5*c*(-((c*x*(b + c*x))/b^2))^(2/3)*(b*x + c*x^2)^(8/3)) + (14*2^(1/3)*3^(3/4)*sqrt(2 - sqrt(3))*b^2*(-((c*(b*x + c*x^2))/b^2))^(8/3)*(1 - 2^(2/3)*(-((c*x*(b + c*x))/b^2))^(1/3))*sqrt((1 + 2^(2/3)*(-((c*x*(b + c*x))/b^2))^(1/3) + 2*2^(1/3)*(-((c*x*(b + c*x))/b^2))^(2/3))/(1 - sqrt(3) - 2^(2/3)*(-((c*x*(b + c*x))/b^2))^(1/3))^2)*Elliptic.F(asin((1 + sqrt(3) - 2^(2/3)*(-((c*x*(b + c*x))/b^2))^(1/3))/(1 - sqrt(3) - 2^(2/3)*(-((c*x*(b + c*x))/b^2))^(1/3))), -7 + 4*sqrt(3)))/(5*c*(b + 2*c*x)*(b*x + c*x^2)^(8/3)*sqrt(-((1 - 2^(2/3)*(-((c*x*(b + c*x))/b^2))^(1/3))/(1 - sqrt(3) - 2^(2/3)*(-((c*x*(b + c*x))/b^2))^(1/3))^2)))]

    @test_int [(b*x + c*x^2)^(5/3), x, 8, (15*(-((c*x*(b + c*x))/b^2))^(2/3)*(b + 2*c*x)*(b*x + c*x^2)^(5/3))/(364*c*(-((c*(b*x + c*x^2))/b^2))^(5/3)) + (3*(-((c*x*(b + c*x))/b^2))^(5/3)*(b + 2*c*x)*(b*x + c*x^2)^(5/3))/(26*c*(-((c*(b*x + c*x^2))/b^2))^(5/3)) - (15*(b + 2*c*x)*(b*x + c*x^2)^(5/3))/(182*2^(1/3)*c*(-((c*(b*x + c*x^2))/b^2))^(5/3)*(1 - sqrt(3) - 2^(2/3)*(-((c*x*(b + c*x))/b^2))^(1/3))) - (15*3^(1/4)*sqrt(2 + sqrt(3))*b^2*(b*x + c*x^2)^(5/3)*(1 - 2^(2/3)*(-((c*x*(b + c*x))/b^2))^(1/3))*sqrt((1 + 2^(2/3)*(-((c*x*(b + c*x))/b^2))^(1/3) + 2*2^(1/3)*(-((c*x*(b + c*x))/b^2))^(2/3))/(1 - sqrt(3) - 2^(2/3)*(-((c*x*(b + c*x))/b^2))^(1/3))^2)*Elliptic.E(asin((1 + sqrt(3) - 2^(2/3)*(-((c*x*(b + c*x))/b^2))^(1/3))/(1 - sqrt(3) - 2^(2/3)*(-((c*x*(b + c*x))/b^2))^(1/3))), -7 + 4*sqrt(3)))/(364*2^(1/3)*c*(b + 2*c*x)*(-((c*(b*x + c*x^2))/b^2))^(5/3)*sqrt(-((1 - 2^(2/3)*(-((c*x*(b + c*x))/b^2))^(1/3))/(1 - sqrt(3) - 2^(2/3)*(-((c*x*(b + c*x))/b^2))^(1/3))^2))) + (5*3^(3/4)*b^2*(b*x + c*x^2)^(5/3)*(1 - 2^(2/3)*(-((c*x*(b + c*x))/b^2))^(1/3))*sqrt((1 + 2^(2/3)*(-((c*x*(b + c*x))/b^2))^(1/3) + 2*2^(1/3)*(-((c*x*(b + c*x))/b^2))^(2/3))/(1 - sqrt(3) - 2^(2/3)*(-((c*x*(b + c*x))/b^2))^(1/3))^2)*Elliptic.F(asin((1 + sqrt(3) - 2^(2/3)*(-((c*x*(b + c*x))/b^2))^(1/3))/(1 - sqrt(3) - 2^(2/3)*(-((c*x*(b + c*x))/b^2))^(1/3))), -7 + 4*sqrt(3)))/(91*2^(5/6)*c*(b + 2*c*x)*(-((c*(b*x + c*x^2))/b^2))^(5/3)*sqrt(-((1 - 2^(2/3)*(-((c*x*(b + c*x))/b^2))^(1/3))/(1 - sqrt(3) - 2^(2/3)*(-((c*x*(b + c*x))/b^2))^(1/3))^2)))]
